#include <algorithm>
#include <string>
#include <vector>

#include "test_runner.h"
#include "profile.h"
#include <iostream>
#include <set>

using namespace std;

class Learner {
 private:
  set<string> dict;
  vector<string> dict2;

 public:
  int Learn(const vector<string>& words) {
    LOG_DURATION("learn");
    size_t first_size = dict.size();
    for (auto& word : words) {
      if(!dict.count(word)) {
        dict.insert(word);
      }
    }
    return dict.size() - first_size;
  }
    /*int Learn2(const vector<string>& words) {
    LOG_DURATION("learn_2");
    int newWords = 0;
    for (const auto& word : words) {
      if (find(dict2.begin(), dict2.end(), word) == dict2.end()) {
        ++newWords;
        dict2.push_back(word);
      }
    }
    return newWords;
  }*/

  vector<string> KnownWords() {
    LOG_DURATION("KnownWord");
    vector<string> dict3;
    for (auto word : dict) {
      dict3.push_back(word);
    }
    return dict3;
  }
  /*vector<string> KnownWords2() {
    LOG_DURATION("KnownWord_2");
    sort(dict2.begin(), dict2.end());
    dict2.erase(unique(dict2.begin(), dict2.end()), dict2.end());
    return dict2;
  }*/
};

int main() {
  Learner learner;
  string line;
  for (int i = 0; i < 3; i++) {
    getline(cin, line);
    vector<string> words;
    stringstream ss(line);
    string word;
    while (ss >> word) {
      words.push_back(word);
    }
    cout << learner.Learn(words) << "\n";
    //cout << learner.Learn2(words) << "\n";
  }
  cout << "=== known words ===\n";
  for (auto word : learner.KnownWords()) {
    cout << word << "\n";
  }
  /*for (auto word : learner.KnownWords2()) {
    cout << word << "\n";
  }*/
}
